public class Solution {
    public int MinimumChanges(string s, int k) {
        int n = s.Length;
        int[,] dp = new int[n + 1, k + 1];
        int[,] cost = new int[n, n];

        for (int len = 2; len <= n; ++len) {
            for (int i = 0; i + len <= n; ++i) {
                int j = i + len - 1;
                cost[i, j] = cost[i + 1, j - 1] + (s[i] == s[j] ? 0 : 1);
                for (int d = 2; d < len; ++d) {
                    if (len % d == 0) {
                        int tmpCost = 0;
                        for (int x = 0; x < d; ++x) {
                            for (int y = x; y < len; y += d) {
                                if (s[i + y] != s[i + x]) tmpCost++;
                            }
                        }
                        cost[i, j] = Math.Min(cost[i, j], tmpCost / 2);
                    }
                }
            }
        }

        for (int i = 0; i <= n; ++i) {
            for (int j = 0; j <= k; ++j) {
                dp[i, j] = int.MaxValue / 2;
            }
        }

        dp[0, 0] = 0;
        for (int i = 1; i <= n; ++i) {
            for (int j = 1; j <= k; ++j) {
                for (int p = 0; p < i; ++p) {
                    dp[i, j] = Math.Min(dp[i, j], dp[p, j - 1] + cost[p, i - 1]);
                }
            }
        }

        return dp[n, k];
    }
}
